import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import MainPage from './Components/Pages/MainPage';
import ConfirmationScreen from './Components/Pages/ConfirmationScreen';
import SeatSelection from './Components/Pages/SeatSelection';
import Login from './Components/Pages/Login';
import Signup from './Components/Pages/Signup';
import PrivateRoute from './Components/Pages/DogrulamaYonlendirme';

const App = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/signup" element={<Signup />} />
        <Route
          path="/mainpage"
          element={
            <PrivateRoute>
              <MainPage />
            </PrivateRoute>
          }
        />
        <Route path="/seatselection" element={<SeatSelection />} />
        <Route path="/confirmationscreen" element={<ConfirmationScreen />} />
      </Routes>
    </BrowserRouter>
  );
};

export default App;
